import React from 'react';
import logo from './logo.svg';
import './App.css';
import TodoList from './component/TodoList'

function App() {
  constructor 
  return (
    <div className="App">
      <p>
        {
          this.todoItems.map((item) => <TodoList title={item}/>)
        }
      </p>
    </div>
  );
}

export default App;
